import logo from './logo.svg';
import './App.css';
import React from "react";
import { Route, Router } from 'react-router-dom';
import SearchPageTemplate from './Componennts/SearchPage';

function App() {
  return (
    <Router>
    <div className="App">

      <Route path="/" element={<SearchPageTemplate />} />
    </div>
    </Router>
  );
}

export default App;
